取り付け簡単！硬質ゴム製汎用スポイラーです。<br>スポーティーなカーボン調！<br>ボディに穴を開けて加工をする必要がありません。取り付け面に粘着テープでの取付けとなります。<br><br><br>●リアスポイラー<br>●ボンネットスポイラー<br>●リップスポイラー<br><br><br>【注意事項】<br>●外気温の影響で、数ミリの伸縮・膨張がある場合があります。取り付け後は影響ありません。<br><br><br>【仕様】<br>サイズ：全長1220mm<br>カラー：カーボン調<br>材質：TPVC<br>品番：BX-410<br>メーカー：BRAITH/ブレイス<style type="text/css">
